import React from 'react'
import { Text, View } from 'react-native'

const Jugador = () => {
    console.log('Está mostrando la vista de jugador')
    return (
        <View style = {{marginTop: 30}}>
        <Text style={{color: 'white'}}>
                vista del Jugador
            </Text>
        </View>
    )
}

export default Jugador
